void payload_generator::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"start_V\" :  \"" << start_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ready_V\" :  \"" << ready_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"packet_num_V\" :  \"" << packet_num_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"payload_len_V\" :  \"" << payload_len_V.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"counter_out_V\" :  \"" << counter_out_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"time_elapse_V\" :  \"" << time_elapse_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"m_axis_data_V\" :  \"" << m_axis_data_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"m_axis_keep_V\" :  \"" << m_axis_keep_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"m_axis_last_V\" :  \"" << m_axis_last_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"m_axis_valid_V\" :  \"" << m_axis_valid_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"done_V\" :  \"" << done_V.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

